import React from "react";
import { Form, Select, Input } from "semantic-ui-react";

function Upload() {
  const options = [
    { key: "w", text: "Website", value: "website" },
    { key: "d", text: "Window Application", value: "window application" },
    { key: "a", text: "Android Application", value: "android application" }
  ];

  return (
    <Form inverted>
      <Form.Field
        control={Select}
        label="Project Type"
        option={options}
        placeholder="Project Type"
      />
      <Form.Field control={Input} label="Title" placeholder="title" />
    </Form>
  );
}

export default Upload;
